(296, 'notifier-cache', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<notifier>\n	<latest>2.5.6.2</latest>\n	<changelog>		\n<![CDATA[\n\n<h4>Version 2.5.6.2</h4>\n<ul>\n<li>Fixed: Featured image upload issue on product posts</li>\n</ul>\n\n<pre>\n-\nchanged files [v 2.5.6.2]\nstyle.css\n/rt-framework/classes/metaboxes.php\n-\n</pre>\n\n\n<h4>Version 2.5.6.1</h4>\n<ul>\n<li>Fixed: Featured image upload & delete issue</li>\n</ul>\n\n<pre>\n-\nchanged files [v 2.5.6.1]\nstyle.css\n/rt-framework/classes/admin.php\n-\n</pre>\n\n\n<h4>Version 2.5.6 - July 9, 2017</h4>\n<ul>\n<li> Added: New page templates for page builders. Select the page template called “Builder Template” or “Builder Page With Slider”  within the “Page Attributes” box to disable the page title,  breadcrumb menu and search box for a page. </li>\n<li> Fixed: Breadcrumb error on sub categories </li>\n</ul>\n\n<pre>\n-\nchanged files [v 2.5.6]\nheader.php\n/rt-framework/functions/rt_breadcrumb.php\nstyle.css\n\nnew file;\nbuilder-template.php\nbuilder-template-with-slider.php\n-\n</pre>\n\n\n\n<h4>Version 2.5.5 - March 20, 2017</h4>\n<ul>\n<li>Fixed:  WP Page titles and improved SEO plugin compatibility </li>\n<li>Added: A new template “Home Page”. Now it is possible to use any page with the home page layout.</li>\n<li>Improved: Responsive logo</li>\n<li>Fixed: Responsive images issue</li>\n</ul>\n\n\n<pre>\n-\nchanged files [v 2.5.5]\nheader.php\n/rt-framework/classes/loading.php\n/css/responsive.css\nstyle.css \n\nnew file;\nhome-page-template.php\n-\n</pre>\n\n\n<h4>Version 2.5.4 - April 29, 2016</h4>\n<ul>\n<li>Fixed: Tabs fixed</li>\n<li>Improved: Sliders for optional title and text visibility </li>\n<li>Improved: PHP 7 support</li>\n<li>Improved: WordPress 4.5 compatibility </li>\n</ul>\n<pre>\n-\nchanged files  [v 2.5.4]\n/style.css \n/js/jquery.tools.min.js\nflex-slider.php\nnivo-slider.php\n[folder] /rt-framework/widgets/\n-\n</pre>\n\n<h4>Version 2.5.3 - August 21, 2015</h4>\n<ul>\n<li>Improved: WordPress 4.3 compatibility </li>\n</ul>\n<pre>\n-\nchanged files  [v 2.5.3]\n/style.css\n[folder] /rt-framework/widgets/ \n-\n</pre>\n\n<h4>Version 2.5.2  - June 19, 2015</h4>\n<ul>\n<li>Fixed:  Search fields issues with WPML</li>\n<li>Updated: PrettyPhoto v3.1.6 </li>\n</ul>\n<pre>\n-\nchanged files  [v 2.5.2]\n/style.css\nsub_page_header.php\nsearchform.php\n/js/prettyphoto.js\n-\n</pre>\n\n<h4>Version 2.5.1  - February 17, 2015</h4>\n<ul>\n<li>Recommended update for everyone. Includes a security fix and several code improvements</li>\n</ul>\n<pre>\n-\nchanged files  [v 2.5.1]\n/style.css\n[folder]/rt-framework/classes/\n-\n</pre>\n\n<h4>Version 2.5  - February 5, 2015</h4>\n<ul>\n<li>Improved: WPML compatibility</li>\n<li>Fixed: Custom color issue with Nivo Slider on mobile devices</li>\n<li>Fixed: Password protected single product page issue </li>\n<li>Fixed: Responsiveness issue with the images that added via editor </li>\n<li>Fixed: Slider shortcode when used in product content that has no tabs (chrome)</li>\n<li>Fixed: Responsiveness issue with the logo image</li>\n<li>Fixed: Missing words in the .po files for the comments section</li>\n</ul>\n\n<h4>Version 2.4</h4>\n<ul>\n<li>Added: WordPress 3.9 support</li>\n<li>Fixed: \"Sidebar for pages” widget area visibility issue</li>\n<li>Improved: Blog list and added “alt” description for the images</li>\n</ul>\n\n<h4>Version 2.3</h4>\n<ul>\n<li>Fixed: WPML related issues fixed</li>\n<li>Fixed: HTML validation issue</li> \n<li>Improved: Wysija plugin compatibility</li>\n</ul>\n\n \n\n<h4>Version 2.2</h4>\n<ul>\n<li>Improved: WordPress 3.6 compatibility</li>\n<li>Improved: WPML compatibility with the plugins latest version </li>\n<li>Improved: Resize image function improved</li>\n<li>Fixed: some styling issues on IE7 </li>\n<li>Fixed: Contact us page translation issues with WPML</li>\n</ul>\n\n\n<h4>Version 2.1</h4>\n<ul>\n<li>Version 2.1 - April 24, 2013</li> \n<li>Fixed: Slider with static home page bug</li> \n<li>Fixed: Visibility issue of portfolio images with mobile phones</li> \n<li>Fixed: Miss-placed sidebar issue on Contact Us page</li> \n<li>Fixed: Product slider shortcode bug on home page</li> \n</ul>\n\n\n<h4>Version 2.0</h4>\n<p>Please note, If you\'ve upgraded from an earlier version to v2.0, you need to select your slider again via Slider Options. </p>\n<ul>\n<li>Added: Responsive layout option</li> \n<li>Added: New slider option; Flex Slider</li> \n<li>Added: New option added for accordion short code to get first one closed</li> \n<li>Added: Free code spaces added for head and footer in General Options</li> \n<li>Improved: Product shortcode</li> \n<li>Improved: Slider shortcode</li> \n<li>Improved: Page load time</li> \n<li>Improved: Shortcodes</li> \n<li>improved: scroller photo slider </li> \n<li>Updated: Nivo slider updated with responsive version</li> \n<li>Updated: PrettyPhoto with it\'s  latest version and optimized for mobile devices</li> \n<li>Fixed: admin panel font selection bug fixed</li> \n<li>Fixed: duplicating content issue fixed </li> \n<li>Fixed: Image resizing issue of WPMU (multisite) with WordPress 3.5.1</li> \n<li>Fixed: Button link edit issue fixed on editor. </li> \n<li>Dropped: WordPress 3.4 support.</li> \n</ul>\n\n\n\n<h4>Version 1.9</h4>\n\n<ul>\n<li>Bug fixed: Product slider shortcode bug fixed</li>\n<li>Improved: CSS Improvements</li>\n<li>Improved: WP Menus, now users are able to change the menu names or assign their existing menus to the menu locations</li> \n<li>Improved: Comment form</li>\n<li>Improved: css files</li>  \n</ul>\n<h5>Affected Files - v1.9</h5>\n\n(functions.php, \ncomments.php, \nloop.php, \nlist_loop.php, \nheader.php, \nfooter.php, \n/style.css, \n/css/style.css, \n/js/jquery.coda-slider-2.0.js, \n/js/script.js, \n/rt-framework/functions/rt_comments.php, \n/rt-framework/classes/sidebar_creator.php, \n/rt-framework/classes/admin.php, \n/rt-framework/classes/loading.php, \n/languages/[all files]\n)\n\n\n<h4>Version 1.8</h4>\n\n<ul>\n<li>Bug fixed: https:// bug</li>\n<li>improved: twitter widget, now shows older tweets</li>\n<li>Bug fixed: e-mail address bug on contact us page</li>\n<li>Bug fixed: Recent posts gallery styling issue fixed</li>\n</ul>\n<h5>Affected Files - v1.8</h5>\n\n(contact_us.php, \n/rt-framework/admin/options/rt_contact_us.php, \n/rt-framework/classes/theme.php, \n/rt-framework/widgets/twitter.php, \n/js/jquery.popeye-2.1.min.js [new file] ) \n\n\n<h4>Version 1.7</h4>\n\n<ul>\n<li>Fixed: pagination bug fixed for WP 3.4 </li>\n<li>Fixed: email icon link bug fixed </li>\n<li>Fixed: Typo fix in the .po file</li>\n<li>Fixed: IE bug on product slider shortcode</li>\n<li>Improved: better plugin compatibility </li>\n<li>Fixed: Slider show / hide bug that affects users who upgraded from previous version of an RT-Theme</li>\n</ul>\n\n<h5>Affected Files - v1.7</h5>\n \n/rt-framework/functions/theme_functions.php<br />\n/rt-framework/functions/rt_shortcodes.php<br />\n/rt-framework/admin/js/script.js<br />\n/rt-framework/admin/css/admin.css<br />\n/languages/<br />\nloading.php<br />\nsingle-products.php<br />\nnivo-slider.php<br />\nslider.php<br />\n\n\n\n\n<h4>Version 1.6</h4>\n\n<ul>\n<li>Added: Product slider shortcode. With this shortcode, products can be display as slider or regular list on home page, regular pages and posts.</li>\n<li>Added: pinterest icon into social media options</li>\n<li>Improved: shortcode support improved on home page posts</li>\n<li>Improved: Image resize functions</li>\n<li>Fixed: iframe bug fixed on photo gallery shortcode</li>\n<li>Fixed: jqery easing bug fixed on cycle slider</li>\n</ul>\n\n<h5>Affected Files - v1.6</h5>\n \nheader.php<br />\nhome_content_loop.php<br />\n/rt-framework/functions/custom_posts.php<br />\n/rt-framework/functions/rt_shortcodes.php<br />\n/rt-framework/functions/shortcode_editor.php<br />\n/rt-framework/classes/theme.php<br />\n/rt-framework/classes/loading.php<br />\n[new file] /js/jquery.coda-slider-2.0.js<br />\n[new file] /css/coda-slider.2.0.css<br />\n[new file] /rt-framework/admin/images/box.png<br />\n[new file] /images/assets/social_media/icon-pinterest.png<br />\n/css/ie7.css<br />\n/css/style.css<br />\n/rt-framework/admin/css/admin.css<br />\n/rt-framework/admin/js/shortcode.js<br />\n/rt-framework/plugins/vt_resize.php<br />\n/rt-framework/functions/theme_functions.php\n \n	\n<h4>Version 1.5</h4>\n\n<ul>	\n\n<li>Added: Close update notifications option to the General Options</li>\n<li>Added: Ability to add custom css codes via Styling Options</li>\n<li>Added: German translation file (de_DE.po/mo file) provided by Angelika Schönweger</li>\n<li>Added: Polish translation file (pl_PL.po/mo file) provided by Maciek Fersten</li>\n<li>Improved: Selected fonts for menu</li>\n<li>Improved: Big product images now fits the page content area on single product pages.</li>\n\n</ul>\n\n<h5>Affected Files - v1.5</h5>\n<ul>\n<li>header.php, \nsingle-products.php, \n/rt-framework/classes/theme.php, \n/rt-framework/classes/admin.php, \n/rt-framework/admin/options/rt_general_options.php, \n/rt-framework/admin/options/rt_styling_options.php, \n/rt-framework/admin/pages/update_notifications.php</li>\n</ul>\n	\n	\n<h4>Version 1.4</h4>\n\n<ul>	\n<li>Fixed: CSS conflicts on slider custom post types at admin panel (WordPress 3.3)</li>  \n</ul>\n\n<h5>Affected Files - v1.4</h5>\n<ul>\n<li>/rt-framework/admin/css/admin.css</li>\n</ul>\n\n<h4>Version 1.3</h4>\n\n<ul>	\n<li>Added: Featured image option for pages</li> \n<li>Added: Child theme support</li> \n<li>Added: WPML flags, bottom of the logo</li> \n<li>Improved: Portfolio thumbnails</li> \n<li>Improved: Big product images now fits the page content on single product page.</li> \n<li>Fixed: Extra gap issue, bottom of pages on Safari and Chrome </li> \n<li>Fixed: Droid Serif font issue</li> \n</ul>\n\n<h5>Affected Files - v1.3</h5>\n<ul>\n<li>header.php, single-products.php, portfolio_loop.php</li>\n<li> /css/style.css </li> \n<li> /rt-framework/classes/theme.php</li>\n<li> /rt-framework/classes/loading.php</li>\n<li> /rt-framework/functions/rt_general_options.php</li> \n</ul>\n	\n<h4>Version 1.2</h4>\n<ul>\n<li>Added: Nivo Slider option</li> \n<li>Added: 25 new Google fonts</li> \n<li>Added: Layered PSD file </li> \n<li>Added: Dutch translation file (by Paul Backus- http://backups.nl)</li> \n<li>Fixed: Google+ icon link issue</li> \n<li>Fixed: Email icon link issue</li> \n<li>Fixed: Strong tag issue</li> \n<li>Fixed: extra gap issue where bottom of contents on Safari and Chrome </li> \n<li>Fixed: Site name (text logo) color issue on custom main colors</li> \n<li>Included: missing wait.gif in /rt-framework/admin/images</li> \n<li>Improved: Twitter widget improved for the conflicts with JetPack\'s twitter widget. Please note: You will need to move your RT-Theme twitter widget, it\'s old place again when you update your theme.</li> \n<li>Improved: Translation files</li> \n<li>Improved: Option text fields supports HTML codes now.</li> \n</ul>\n\n<h5>Affected Files - v1.2</h5>\n<ul>\n<li>header.php, theme.php, index.php</li>\n<li> /css/style.css </li>\n<li> /js/scripts.js </li>\n<li> /rt-framework/classes/admin.php</li>\n<li> /rt-framework/classes/loading.php</li>\n<li> /rt-framework/admin/options/rt_styling_options.php </li>\n<li> /rt-framework/admin/options/rt_slider_options.php</li>\n<li> /rt-framework/admin/options/rt_social_options.php</li>\n<li> /rt-framework/functions/rt_shorcodes.php</li> \n</ul> \n	\n\n<h4>Version 1.1</h4>\n<ul>\n<li>New Feature: Remove Curvs option added to styling options </li> \n<li>New Feature: Attached documents option added to products</li> \n<li>Improved: Photo gallery shortcode now supports captions</li>\n<li>Improved: Google+ icon included into the social media icon list</li>\n<li>Fixed: Issue when using native WordPress backgrounds on red skin.</li>\n<li>Fixed: Padding issue on slider titles.</li>\n<li>Included: Turkish translation  (.mo/.po)</li>	\n</ul>\n<h5>Affected Files - v1.1</h5>\n<ul>\n<li> rt-framework/admin/options/rt_styling_options.php </li>\n<li> rt-framework/admin/js/shortcodes.js</li>\n<li> rt-framework/functions/rt_shortcodes.php</li>\n<li> rt-framework/classes/loading.php</li>\n<li> header.php</li>\n<li> footer.php</li>\n<li> rt-framework/admin/options/product_custom_fields.php </li>\n<li> single-products.php</li>\n<li> rt-framework/admin/options/product_custom_fields.php </li> \n</ul>\n	\n<h4>Version 1.0</h4>\n<ul>\n<li>Initial theme version.</li> \n</ul>\n]]>\n	</changelog>\n</notifier>', 'yes'),
