(914, 1, '2018-10-08 10:58:51', '2018-10-08 13:58:51', 'A<strong> ACDN</strong> (associação da criança com distúrbios neurológicos) tem como missão dar todo apoio aos familiares e as crianças já diagnosticadas com algum tipo de distúrbio neurológico.\r\n\r\nO nosso trabalho consiste em fornecer os medicamentos, fraldas, cestas básicas e também transmitirmos segurança, amor, carinho para que possam prosseguir o tratamento na certeza de que existem pessoas preocupadas com o seu bem estar.\r\n\r\nAqui estão algumas fotos da equipe da ACDN com os cadastrados e alguns de seus familiares. Fazemos isso em respeito aos colaboradores para que saibam que suas doações estão sendo bem empregadas.\r\n\r\nAgradecemos a todos pela confiança depositada em nós que deus venha abençoar a cada um que com sua doação está abençoando as crianças cadastradas.\r\n\r\nA ACDN deixa claro que na associação não tem crianças internas, nossas doações consistem em levar até a criança o que a família solicitou como os medicamentos, as fraldas, os leites e as cestas básicas.\r\n\r\nTemos todas as doações registradas através de fotos e recibos. Também estamos a disposição para esclarecer eventuais dúvidas.\r\n\r\n<span style=\"color: #ff0000;\"><strong>Obs:</strong> Só faça a sua doação se o mensageiro estiver com a camisa da ACDN, o recibo contendo nossos dados (endereço, telefone, cnpj). Para demais esclarecimentos favor ligar para <strong>(31)3841-0816</strong> ou venha nos visitar na rua xingú nº 19 A, bairro universitário Coronel Fabriciano.</span>\r\n\r\nA ACDN desde já agradece a sua atenção.', 'Sobre Nós', '', 'publish', 'open', 'open', '', 'sobre', '', '', '2018-10-23 19:46:28', '2018-10-23 21:46:28', '', 0, 'http://localhost/acdn/?page_id=914', 1, 'page', '', 0),
