(964, 1, '2018-05-08 13:45:19', '2018-05-08 16:45:19', 'A<strong> ACDN</strong> (associação da criança com distúrbios neurológicos) tem como missão dar todo apoio aos familiares e as crianças já diagnosticadas com algum tipo de distúrbio neurológico.\r\n\r\nO nosso trabalho consiste em fornecer os medicamentos, fraldas, cestas básicas e também transmitirmos segurança, amor, carinho para que possam prosseguir o tratamento na certeza de que existem pessoas preocupadas com o seu bem estar.\r\n\r\nAqui estão algumas fotos da equipe da ACDN com os cadastrados e alguns de seus familiares. Fazemos isso em respeito aos colaboradores para que saibam que suas doações estão sendo bem empregadas.\r\n\r\nAgradecemos a todos pela confiança depositada em nós que deus venha abençoar a cada um que com sua doação está abençoando as crianças cadastradas.\r\n\r\nA ACDN deixa claro que na associação não tem crianças internas, nossas doações consistem em levar até a criança o que a família solicitou como os medicamentos, as fraldas, os leites e as cestas básicas.\r\n\r\nTemos todas as doações registradas através de fotos e recibos. Também estamos a disposição para esclarecer eventuais dúvidas.\r\n\r\n<span style=\"color: #ff0000;\"><strong>Obs:</strong> Só faça a sua doação se o mensageiro estiver com a camisa da ACDN, o recibo contendo nossos dados (endereço, telefone, cnpj). Para demais esclarecimentos favor ligar para <strong>(31)3841-0816</strong> ou venha nos visitar na rua xingú nº 19 A, bairro universitário Coronel Fabriciano.</span>\r\n\r\nA ACDN desde já agradece a sua atenção.', 'Sobre Nós', '', 'inherit', 'closed', 'closed', '', '914-revision-v1', '', '', '2018-05-08 13:45:19', '2018-05-08 16:45:19', '', 914, 'http://localhost/acdn/2018/05/08/914-revision-v1/', 0, 'revision', '', 0),
(965, 1, '2018-05-08 13:45:31', '2018-05-08 16:45:31', 'A ACDN tem como missão dar todo apoio aos familiares e as crianças já diagnosticadas com algum tipo de distúrbio neurológico.\r\n\r\n<strong>Como a ACDN atuará?</strong>\r\nAssim que a família procurar a ACDN a assistente social fará um diagnóstico para detectar quais são as reais necessidades da criança para assim começarmos o nosso trabalho que é fornecer os medicamentos, fraldas, cestas básicas e também transmitirmos segurança, amor, carinho para que possam prosseguir o tratamento na certeza de que existem pessoas preocupadas com o seu bem estar.\r\n\r\n<span style=\"color: #339966;\"><strong>Sem a sua ajuda a ACDN não existe!</strong></span>\r\n\r\n<span style=\"color: #ff0000;\"><strong>Obs:</strong> Só faça a sua doação se o mensageiro estiver com a camisa da ACDN, crachá e o recibo contendo nossos dados (endereço, telefone, cnpj). Para demais esclarecimentos favor ligar para (31) 3841-0816 ou venha nos visitar na rua xingú nº 19 a, bairro universitário coronel fabriciano.</span>\r\n\r\nA acdn desde já agradece a sua colaboração.\r\n\r\n<strong>ATENÇÃO</strong>\r\n(para doações de cidades diferentes das listadas abaixo, favor entrar em contato pelo telefone (31)3841-0816)\r\n\r\n<strong>Temos mensageiros atuando nas seguintes cidades:</strong>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Coronel Fabriciano</td>\r\n<td>Ipatinga</td>\r\n<td>Timóteo</td>\r\n</tr>\r\n<tr>\r\n<td>Dom Cavati</td>\r\n<td>Antônio Dias</td>\r\n<td>São Domingos do Prata</td>\r\n</tr>\r\n<tr>\r\n<td>Marliéria</td>\r\n<td>Jaguaraçu</td>\r\n<td>São Gonçalo do Rio Abaixo</td>\r\n</tr>\r\n<tr>\r\n<td>São José do Goiabal</td>\r\n<td>Dionísio</td>\r\n<td>Baixa Verde</td>\r\n</tr>\r\n<tr>\r\n<td>Santana do Paraíso</td>\r\n<td>Alvinópolis</td>\r\n<td>Bela Vista de Minas</td>\r\n</tr>\r\n<tr>\r\n<td>Rio Piracicaba</td>\r\n<td>Dom Silvério</td>\r\n<td>Nova Era</td>\r\n</tr>\r\n<tr>\r\n<td>Barão de Cocais</td>\r\n<td>Ipaba</td>\r\n<td>Iapu</td>\r\n</tr>\r\n<tr>\r\n<td>Bugre</td>\r\n<td>João Monlevade</td>\r\n<td>Santa Barbara</td>\r\n</tr>\r\n<tr>\r\n<td>Caratinga</td>\r\n<td>Itabira</td>\r\n<td>Mesquita</td>\r\n</tr>\r\n<tr>\r\n<td>Joanésia</td>\r\n<td>Entre Folhas</td>\r\n<td>Vargem Alegre</td>\r\n</tr>\r\n<tr>\r\n<td>Braúnas</td>\r\n<td>Açucena</td>\r\n<td>Bom Jesus do Galho</td>\r\n</tr>\r\n<tr>\r\n<td>Córrego Novo</td>\r\n<td></td>\r\n<td></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong>Futuramente Naque, Periquito, Raul Soares e São João do Oriente.</strong>', 'Faça uma doação', '', 'inherit', 'closed', 'closed', '', '907-revision-v1', '', '', '2018-05-08 13:45:31', '2018-05-08 16:45:31', '', 907, 'http://localhost/acdn/2018/05/08/907-revision-v1/', 0, 'revision', '', 0),
