e. Além disso, muitas vezes são sequer reconhecidos como um “problema” e passam despercebidos pelos pacientes e seus médicos. Cabe então ao neurologista atento perceber que, muitas vezes, aquela pessoa com queixas frequentes de memória, atenção, dores de cabeça, mau humor, etc. tem, na verdade, um problema de sono, como insônia crônica ou apneia de sono, para a partir daí oferecer o tratamento mais adequado para cada situação. Nesse sentido, é gratificante ouvir pacientes e cônjuges falando sobre a satisfação de voltar a ter uma “noite tranquila de sono”.\r\n\r\n\r\n7. Epilepsias (Convulsões)\r\nInfelizmente, ainda há muito estigma quanto à epilepsia, um problema neurológico muito comum em crianças e adolescentes e que também afeta inúmeros adultos no Brasil. Isso precisa mudar e, hoje, até a legislação brasileira tem caminhado na direção de cada vez mais incluir o portador de epilepsia na sociedade. Assim sendo, foi-se o tempo em que não se podia fazer isso ou aquilo. O epiléptico bem controlado, que toma a sua medicação regularmente e faz o devido acompanhamento com seu neurologista tem hoje exatamente os mesmos direitos e deveres que qualquer cidadão brasileiro, ou seja, não é diferente de ninguém. Cabe ao neurologista, portanto, auxiliar o seu paciente e engajá-lo em um tratamento responsável e de longo prazo, proporcionando um ciclo virtuoso livre de crises, além de estabelecer metas e prazos para os indivíduos cuja medicação poderá vir a ser retirada.\r\n\r\n\r\n8. Esclerose Múltipla\r\nA esclerose múltipla pode ter uma apresentação clínica muito variada, com sintomas neurológicos recorrentes que podem “melhorar” por si só com o tempo (perda da visão, alteração de sensibilidade, dificuldade para caminhar, etc.). Ocorre normalmente em mulheres jovens, entre os 20 e 35 anos, sendo um problema relativamente comum que leva os pacientes a procurarem a opinião de um neurologista. O primeiro cuidado necessário com a esclerose múltipla é saber que existem diversas out